(322, 24, 'Sakra (2023) BluRay', 'When a respected martial artist is accused of killing, he goes around in search of answers about his own mysterious origin story and the unknown enemies working to destroy him.', '2023-03-10', 'https://mkdirmoviee.000webhostapp.com/public/images/1682578007_eb0ff2b419a7a0353875.webp', '2023-03-09 22:47:06', 'show', 'Movie', '2023-06-26 23:48:00', 'https://subscene.icu/subtitles/sakra-tin-lung-baat-bou', 'https://www.youtube.com/watch?v=ecpoT3OE3y8&feature=youtu.be'),
