(328, 24, 'The Girl Who Escaped: The Kara Robinson Story ', 'A story of survival about a young woman who took down a serial killer. 15-year-old Kara was approached by a man who put a gun to her neck and forced her into his car. He took her to his apartment, held her captive and sexually assaulted her. While he slept, Kara escaped and led police to the apartment, and identified her captor, a serial killer responsible for at least three unsolved homicides.', '2022-07-13', 'https://mkdirmoviee.000webhostapp.com/public/images/1678683527_83737541c83c10553dee.webp', '2023-03-13 04:58:47', 'hide', 'Movie', '2023-06-26 23:48:49', '', 'https://youtu.be/W7Nl80jBDck'),
(329, 24, 'Magic Mike’s Last Dance (2023)', 'Magic Mike\'s Last Dance is a 2023 American comedy-drama film directed by Steven Soderbergh, written by Reid Carolin, and produced by Channing Tatum. It is the third and final installment in the Magic Mike trilogy, following Magic Mike and Magic Mike XXL. The film stars Channing Tatum as the titular retired male stripper, who leaves Florida for London to help a socialite produce a stage play.', '2023-03-15', 'https://mkdirmoviee.000webhostapp.com/public/images/1682509844_559a54994d8f96ec6cc3.webp', '2023-03-14 23:22:54', 'show', 'Movie', '2023-06-26 23:48:57', 'https://subscene.icu/subtitles/magic-mikes-last-dance', 'https://www.youtube.com/watch?v=IJsiX3z9WvM'),
(330, 24, 'Missing (2023)', 'Missing is a 2023 American screenlife thriller film written and directed by Will Merrick and Nick Johnson from a story by Sev Ohanian and Aneesh Chaganty, who also produced the film with Natalie Qasabian. The film is a standalone sequel to Searching. It stars Storm Reid, Joaquim de Almeida, Ken Leung, Amy Landecker, Daniel Henney, and Nia Long. Its plot follows June Allen, a teenager who tries to find her missing mother after she disappears on vacation in Colombia with her new boyfriend.', '2023-03-18', 'https://mkdirmoviee.000webhostapp.com/public/images/1685766822_8be8d22bd1447ef351ce.webp', '2023-03-18 03:16:06', 'show', 'Movie', '2023-06-26 23:49:02', 'https://subscene.icu/subtitles/missing-2023', 'https://www.youtube.com/watch?v=QjxVxmo2z_g&embeds_euri=https%3A%2F%2F84.46.254.230%2F&feature=emb_logo'),
(331, 24, 'The Secret Romantic Guesthouse Eps 6 Added', 'Yoon Dan Oh had enjoyed a comfortable life as the beloved youngest daughter of a well-off family, but no longer. Now the family breadwinner, she runs the Ihwawon Inn. Current guests are scholars taking the civil service entrance exam in the hopes of becoming high-ranking officials.\r\n\r\nAmong them are Kang San, Kim Si Yeol, and Jeong Yoo Ha, who all have deep secrets. They and Yoon Dan Oh will share information and cooperate to find Lee Seol, who disappeared 13 years ago.', '2023-03-21', 'https://mkdirmoviee.000webhostapp.com/public/images/1682509828_c35e71c1b89adf2ba4db.webp', '2023-03-20 22:11:17', 'show', 'Series', '2023-06-26 23:49:09', 'https://indexsubtitle.com/subtitles/the-secret-romantic-guesthouse-the-love-story-of-flower-scholars-kkotseonbi-yeolaesa', 'https://www.youtube.com/watch?v=IAHeoyGMT5A&feature=youtu.be'),
(332, 24, 'Avatar: The Way of Water (2022) WEB-DL', 'Jake Sully lives with his newfound family formed on the extrasolar moon Pandora. Once a familiar threat returns to finish what was previously started, Jake must work with Neytiri and the army of the Na\'vi race to protect their home.', '2023-03-28', 'https://mkdirmoviee.000webhostapp.com/public/images/1682509807_4a8c4d3e2a7ff7463368.webp', '2023-03-27 21:00:24', 'show', 'Movie', '2023-06-26 23:49:15', 'https://subscene.icu/subtitles/avatar-the-way-of-water', 'https://youtu.be/a8Gx8wiNbs8'),
(333, 24, 'Mummies (2023) WEB-DL', 'It follows three mummies as they end up in present-day London and embark on a journey in search of an old ring belonging to the Royal Family, stolen by the ambitious archaeologist Lord Carnaby.', '2023-03-29', 'https://mkdirmoviee.000webhostapp.com/public/images/1685766788_43c038b35c95f1e24b9a.webp', '2023-03-29 10:25:12', 'show', 'Movie', '2023-06-26 23:49:22', 'https://youtu.be/WRB8YIc4U68', 'https://subscene.icu/subtitles/mummies'),
(334, 24, 'Creed III (2023)', 'Creed III is a 2023 American sports drama film directed, produced by and starring Michael B. Jordan from a screenplay by Keenan Coogler and Zach Baylin. It is the sequel to Creed II, the third in the Creed film series, and the ninth overall in the Rocky film series. It also stars Tessa Thompson, Jonathan Majors, Wood Harris, Mila Davis-Kent, Florian Munteanu and Phylicia Rashad. In the film, the accomplished and recently retired boxer Adonis Creed comes face-to-face with his childhood friend and former boxing prodigy Damian Anderson.', '2023-04-04', 'https://mkdirmoviee.000webhostapp.com/public/images/1682509791_e64c1ff789a08a49e5d7.webp', '2023-04-04 02:43:14', 'show', 'Movie', '2023-06-26 23:49:28', '', 'https://youtu.be/AHmCH7iB_IM'),
(335, 24, 'Kill Boksoon (2023)', 'Kill Boksoon is a 2023 South Korean crime action film directed and written by Byun Sung-hyun, starring Jeon Do-yeon, Sol Kyung-gu, Kim Si-a, Esom, and Koo Kyo-hwan. It premiered on Netflix on March 31, 2023.', '2023-04-04', 'https://mkdirmoviee.000webhostapp.com/public/images/1682509772_13614a6bf90ea46f2759.webp', '2023-04-04 02:47:18', 'show', 'Movie', '2023-06-26 23:49:34', '', 'https://youtu.be/70e5RjgkHjU'),
(336, 24, 'Murder Mystery 2 (2023)', 'Murder Mystery 2 is a 2023 American action comedy mystery film directed by Jeremy Garelick and written by James Vanderbilt. It is a sequel to the 2019 film Murder Mystery, and it stars Adam Sandler and Jennifer Aniston.', '2023-04-05', 'https://mkdirmoviee.000webhostapp.com/public/images/1687822785_16a19ec6979a9d50e351.webp', '2023-04-05 01:41:02', 'show', 'Movie', '2023-06-26 23:39:45', 'https://subscene.icu/subtitles/murder-mystery-2', 'https://youtu.be/LM2F56uK0fs'),
(337, 24, 'Tetris (2023) WEB-DL', 'Tetris is a 2023 biographical thriller film directed by Jon S. Baird and written by Noah Pink. The film stars Taron Egerton, Nikita Efremov, Sofia Lebedeva, and Anthony Boyle. It’s based on true events around the race to license and patent the video game Tetris from Russia in the late 1980s during the Cold War.', '2023-04-05', 'https://mkdirmoviee.000webhostapp.com/public/images/1687822717_5950549f5f169a4551b7.webp', '2023-04-05 01:48:39', 'show', 'Movie', '2023-06-26 23:38:37', 'https://subscene.icu/subtitles/tetris', 'https://youtu.be/zGjVC09g4rw'),
(338, 24, 'Assassin (2023) WEB-DL', 'Assassin is a 2023 American science fiction action film starring Nomzamo Mbatha, Dominic Purcell and Bruce Willis. It was directed by Jesse Atlas, in his feature film directorial debut, written by Aaron Wolfe, and is based on Atlas and Wolfe\'s short film Let Them Die Like Lovers.', '2023-04-05', 'https://mkdirmoviee.000webhostapp.com/public/images/1687822679_2455771b202e16e3e463.webp', '2023-04-05 01:55:01', 'show', 'Movie', '2023-06-26 23:37:59', '', 'https://youtu.be/yUn5bHyIqPo'),
(339, 24, 'HeartBeat Eps 6 Added', '-', '2023-06-27', 'https://mkdirmoviee.000webhostapp.com/public/images/1687838509_49e9c70c2ec15349ccbd.webp', '2023-06-27 04:01:49', 'show', 'Series', '2023-07-11 22:35:31', 'https://subscene.icu/subtitles/heartbeat-my-heart-is-beating-gaseumi-ddwinda', 'https://youtu.be/DnLcRvM0D7Q'),
(342, 24, 'King the Land Eps 8 Added', 'Amid a tense inheritance fight, a charming heir clashes with his hardworking employee who’s known for her irresistible smile — which he cannot stand.', '2023-06-27', 'https://mkdirmoviee.000webhostapp.com/public/images/1687839305_a52e5bf507c9b4bd81b8.webp', '2023-06-27 04:15:05', 'show', 'Series', '2023-07-10 03:24:05', 'https://subscene.icu/subtitles/king-the-land-kingdeolaendeu', 'https://youtu.be/AGF16szMOmo'),
(343, 24, 'See You in My 19th Life Eps 8 Added', 'Ban Ji-eum can endlessly reincarnate. But when her 18th life gets cut short, she dedicates the next one to finding her now grown-up childhood love.', '2023-06-27', 'https://mkdirmoviee.000webhostapp.com/public/images/1687839984_4bd056db6560e90e1e00.webp', '2023-06-27 04:26:24', 'show', 'Series', '2023-07-10 03:25:32', 'https://subscene.icu/subtitles/see-you-in-my-19th-life-please-take-care-of-me-in-this-life-as-well-ibeon-saengdo-jal-butaghae', 'https://youtu.be/orAIH67EU-I'),
